sources.styles\\utils\\_variables.scss:
$main-font-family: poppins, sans-serif;
$main-color: #fff;
$main-padding: 0 20px;

@mixin background-img() {
  background-repeat: no-repeat;
  background-size: cover;
  box-sizing: border-box;
}

@mixin picture-description() {
  color: $main-color;
  font-family: $main-font-family;
  font-size: 16px;
  font-style: normal;
  font-weight: 400;
  line-height: 140%;
  padding-top: 8px;
}

@mixin address-information($font-size, $font-weight, $padding-top) {
  color: $main-color;
  font-family: $main-font-family;
  font-style: normal;
  line-height: 140%; /* 19.6px */
  font-size: $font-size;
  font-weight: $font-weight;
  padding-top: $padding-top;
}

sources.styles\\blocks\\tittle.scss:
.tittle {
  color: #fff;
  text-align: center;
  font-family: $main-font-family;
  font-size: 36px;
  font-style: normal;
  font-weight: 700;
  line-height: 36px;
  letter-spacing: -1.5px;
  padding-top: 0;

  &--second {
    font-size: 32px;
    font-weight: 500;
    line-height: 100%; /* 32px */
    padding-top: 92px;
  }

  &--secondary {
    padding-top: 60px;
    text-align: left;
  }

  &--third {
    font-size: 24px;
    line-height: 140%;
    padding-top: 32px;
    text-align: left;
  }

  &--four {
    display: flex;
    justify-content: center;
    font-size: 32px;
    font-weight: 500;
    line-height: 32px; /* 100% */
    text-transform: capitalize;
    padding-top: 60px;
  }
}

@media screen and (min-width: 744px) {
  .tittle {
    font-size: 64px;
    padding-top: 0;

    &--second {
      font-size: 48px;
      padding-top: 132px;
    }

    &--secondary {
      padding-top: 0;
      text-align: left;
      font-size: 48px;
    }

    &--third {
      font-size: 32px;
    }

    &--four {
      font-size: 48px;
      padding-top: 120px;
    }
  }
}

@media screen and (min-width: 1260px) {
  .tittle {

    &--second {
      font-size: 64px;
      padding: 164px 0 0;
    }

    &--four {
      font-size: 64px;
      padding-top: 180px;
    }
  }
}

