sources.styles\\blocks\\compare.scss:
.compare {
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: repeat(4, auto-fit);
  padding: $main-padding;
  gap: 40px 0;
}

.product {

  &__box {
    width: 100%;
    overflow: hidden;
  }

  &__img {
    width: 100%;
    height: 100%;
    object-fit: contain;
    box-sizing: content-box;
    transition: transform 0.3s;
    transform-origin: bottom;
  }

  &__tittle {
    color: #fff;
    font-family: $main-font-family;
    font-size: 24px;
    font-style: normal;
    font-weight: 700;
    line-height: 140%;
    padding-top: 32px;

    &--price {
      padding-top: 16px;
    }
  }

  &__descript {
    @include picture-description();
  }
}

@media screen and (min-width: 744px) {
  .compare {
    display: grid;
    grid-template-columns: 1fr;
    grid-template-rows: repeat(4, auto-fit);
    padding: 48px 176px 0;
    gap: 48px 0;
  }

  .product {

    &__tittle {
      padding-top: 0;

      &--price {
        padding-top: 8px;
      }
    }
  }
}

@media screen and (min-width: 1260px) {
  .compare {
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-template-rows: repeat(4, auto-fit);
    padding: 56px 120px;
    gap: 0 24px;
    max-width: 1500px;
    margin: 0 auto;
  }

  .product {

    &:hover &__img {
      transform: scale(1.05);
    }

    &__tittle {

      &--price {
        padding-top: 16px;
      }
    }
  }
}

sources.styles\\blocks\\characteristic.scss:
.characteristic {
  display: grid;
  grid-template-columns: 1fr;
  // padding: $main-padding;
}

.details {
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: $main-padding;
  padding: 40px 20px 0;

  &__picture {
    height: 100%;
    overflow: hidden;

    &-img {
      width: 100%;
      height: 100%;
      object-fit: cover;
      transition: transform 0.3s;
      transform-origin: bottom;
      box-sizing: border-box;
    }
  }

  &__tittle {
    grid-column: 1 / -1;
    grid-row: 2 / 3;
    color: #fff;
    font-family: $main-font-family;
    font-size: 24px;
    font-style: normal;
    font-weight: 700;
    line-height: 140%; /* 33.6px */
    padding-top: 16px;
  }

  &__descript {
    grid-column: 1 / -1;
    grid-row: 3 / 4;
    @include picture-description();
  }
}

.link {
  display: grid;
  width: calc(280px - 96px);
  height: 56px;
  padding: 0 40px;
  margin: 48px auto;
  justify-content: center;
  align-items: center;
  flex-shrink: 0;
  border-radius: 40px;
  border: none;
  background-color: #fff;
  color: #1d1d1d;
  text-align: center;
  font-family: $main-font-family;
  font-size: 16px;
  font-style: normal;
  font-weight: 700;
  line-height: 27px; /* 168.75% */
  text-decoration: none;
}

@media screen and (min-width: 744px) {
  .characteristic {
    display: grid;
    grid-template-columns: 1fr;
    padding: 0 72px;
  }

  .details {
    grid-template-columns: 1fr 1fr 1fr;

    &__picture {

      &--1 {
        grid-column: 1 / 3;
      }

      &--2 {
        grid-column: 3 / -1;
      }

      &--3 {
        grid-column: 1 / 2;
      }

      &--4 {
        grid-column: 2 / -1;
      }

      &-img {
        object-fit: cover;
      }
    }
  }

  .link {
    width: calc(392px - 96px - 2px);
    margin-bottom: 0;
  }
}

@media screen and (min-width: 1260px) {
  .characteristic {
    padding: 0 120px;
    max-width: 1500px;
    margin: 0 auto;
  }

  .details {

    &__picture-img:hover {
      transform: scale(1.05);
    }

    &__descript {
      width: 66%;
    }
  }

  .link {
    width: calc(324px - 96px);

    &:hover {
      box-shadow: 1px 4px 16px 0 rgba(232, 232, 240, 0.4);
    }

    &:active {
      box-shadow: 1px 4px 16px 0 rgba(232, 232, 240, 0.64);
    }
  }
}

