.navigation {
  display: flex;
  justify-content: space-between;
  padding-top: 24px;
  align-items: center;

  &__icon {
    display: flex;
    align-items: center;
    flex-direction: row;
    gap: 24px;
  }

  &__call {
    background-image: url("../images/phone.svg");
    background-position: center;
    background-size: contain;
    height: 24px;
    width: 24px;
  }

  &__item-menu {
    background-image: url("../images/Icon-Burger-menu.svg");
    background-position: center;
    background-size: contain;
    height: 24px;
    width: 24px;
    transition: background-image 0.3s ease;

    &:hover {
      background-image: url("../images/Icon-Burger-menu-hover.svg");
    }
  }

  &__item {

    &--hidden {
      opacity: 0;
      height: 24px;
    }

    &-tel {
      color: #fff;
      text-align: center;
      font-family: $main-font-family;
      font-size: 12px;
      font-style: normal;
      font-weight: 700;
      line-height: 16px; /* 133.333% */
      letter-spacing: 2px;
      text-transform: uppercase;
      padding-right: 20px;
      position: absolute;
      right: 50px;
      top: -50px;
      opacity: 0;
      transition: opacity 0.3s ease;
      text-decoration: none;
    }

    &--number {
      span {
        opacity: 0;
      }
    }

    &-logo {
      height: 38px;
    }
  }

  &__logo {
    height: 38px;
  }
}

.menu {
  position: fixed;
  top: 0;
  left: 0;
  right: 0;
  transform: translateX(+100%);
  min-height: 100vh;
  background: #c2c2c2;
  padding: 0 20px;
  display: flex;
  flex-direction: column;
  transition: transform 0.3s;

  &:target {
    transform: translateX(0);
  }

  &__paragraph {
    color: #1d1d1d;
    font-family: $main-font-family;
    font-size: 16px;
    font-style: normal;
    font-weight: 600;
    line-height: 27px; /* 168.75% */
    text-transform: uppercase;
    margin-top: 40px;

    &--link {
      text-decoration: none;
      color: #1d1d1d;
    }
  }

  &__call-link {
    color: #1d1d1d;
    font-family: $main-font-family;
    font-size: 12px;
    font-style: normal;
    font-weight: 600;
    line-height: 16px; /* 133.333% */
    letter-spacing: 2px;
    text-transform: uppercase;
    margin-top: 16px;
    padding-bottom: 8px;
    text-decoration: none;
    border-bottom: 1px solid #1d1d1d;
  }
}

.page-navigation {

  &__item {
    margin-top: 32px;
  }

  &__link {
    text-decoration: none;
    color: #1d1d1d;
    font-family: $main-font-family;
    font-size: 22px;
    font-style: normal;
    font-weight: 600;
    line-height: 22px; /* 100% */
    letter-spacing: 2px;
    text-transform: uppercase;
    border-bottom: 1px solid transparent;

    &:hover {
      border-bottom: 1px solid #1d1d1d;
    }
  }
}

@media screen and (min-width: 744px) {
  .menu {
    padding: 0 72px;
  }

  .navigation {
    display: flex;
    justify-content: space-between;
    padding-top: 36px;
    align-items: center;

    &__icon {
      gap: 32px;
    }

    &__call {
      height: 32px;
      width: 32px;
    }

    &__item {
      margin: 0;

      &--hidden {
        opacity: 0;
        height: 32px;
      }

      &--number:hover {
        span {
          opacity: 1;
        }
      }

      &-logo {
        height: 56px;//
      }

      &-menu {
        height: 32px;
        width: 32px;
      }
    }

    &__logo {
      height: 56px;
    }
  }

  .page-navigation {

    &__item {
      margin-top: 32px;
    }
  }
}

@media screen and (min-width: 1260px) {
  .menu {
    padding: 0 120px;
  }

  .navigation__item {

    &-logo {
      height: 56px;
    }

    .page-navigation {
      padding: 36px 0 0;
    }
  }

  .navigation__call:hover .navigation__item-tel {
    opacity: 1;
    top: 56px;
    right: 236px;
  }
}

