sources.styles\\blocks\\contact.scss:
.contact {
  display: grid;
  grid-template-columns: 1fr;
}

.form {
  padding: 32px 20px 24px;
  display: flex;
  flex-direction: column;

  &-item {
    padding-top: 16px;
    border-radius: border-box;
  }

  &__label {
    padding: 116px 0;
  }
  &-item__input {
    width: calc(100% - 32px);
    height: 48px;
    flex-shrink: 0;
    color: #292929;
    font-family: $main-font-family;
    font-size: 14px;
    font-style: normal;
    font-weight: 400;
    line-height: 20px; /* 142.857% */
    border-radius: 40px;
    padding: 0 16px;
    margin: 0;
    border: 0;

    &:focus-visible {
      outline: none;
    }

    &::placeholder {
      color: #7e7e83;
    }
  }
  &-item__textarea {
    display: flex;
    width: calc(100% - 32px);
    min-height: 120px;
    padding: 14px 16px;
    align-items: flex-start;
    gap: 14px;
    color: #292929;
    border: 0;
    border-radius: 16px;
    background: #f8f8fa;
    font-family: $main-font-family;

    &:focus-visible {
      outline: none;
    }

    &::placeholder {
      color: #7e7e83;
    }
  }
  &-item__button {
    display: flex;
    width: 100%;
    height: 56px;
    padding: 0 48px;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    flex-shrink: 0;
    border-radius: 40px;
    background: #fff;
    border: none;
    margin-top: 32px;
    color: #1d1d1d;
    text-align: center;
    font-family: $main-font-family;
    font-size: 16px;
    font-style: normal;
    font-weight: 700;
    line-height: 27px;
    transition: box-shadow 0.3s;
  }
}

.address {
  padding: 0 20px 120px;

  &__label {
    @include address-information(14px, 400, 24px);
  }

  &__content {
    @include address-information(16px, 500, 8px);

    &--tel {
      text-decoration: none;

      &:hover {
        color: rgb(218, 62, 80);
      }
    }

    &--email {
      text-decoration: none;

      &:hover {
        color: rgb(218, 62, 80);
      }
    }

    &--adres {
      text-decoration: none;

      &:hover {
        color: rgb(218, 62, 80);
      }
    }
  }
}

@media screen and (min-width: 744px) {
  .contact {
    grid-template-columns: 1fr 1fr;
    padding: 0 72px 120px;
  }

  .form {
    padding: 48px 12px 24px 0;
  }

  .address {
    padding: 24px 72px 120px 12px;
  }
}

@media screen and (min-width: 1260px) {
  .contact {
    padding: 0 120px 180px;
    max-width: 1500px;
    align-content: center;
    margin: 0 auto;
  }

  .form {
    padding: 48px 99px 24px 0;

    &-item {

      &__button:hover {
        cursor: pointer;
        box-shadow: 1px 4px 16px 0 rgba(232, 232, 240, 0.4);
      }

      &__button:active {
        cursor: pointer;
        box-shadow: 1px 4px 16px 0 rgba(232, 232, 240, 0.64);
      }
    }
  }

  .address {
    padding: 48px 99px 120px;
  }
}

